import React from "react";
import "../css/PersonalArea.css";
import profileImage from "../img/profile"; // Импортируем изображение профиля

class PersonalArea extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
            <div id="all_Id">
                <div id="menu">
                    <div id="Profile">
                        <div id="PlaceProfilePhoto">
                            {/* Добавляем изображение профиля */}
                            <div id="ProfilePhoto" style={{ backgroundImage: `url(${profileImage})` }}></div>
                            <div id="Mask" className="mask"></div>
                            <div id=""></div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default PersonalArea;
